import React from "react";

const About = () => {
  return (
    <section id="about" style={{ padding: "40px 20px", backgroundColor: "#f9f9f9" }}>
      <h2>About Me</h2>
      <p>
        Hi, I’m Stanley, a software engineer with expertise in building innovative and scalable solutions for complex problems. My work is centered around AI and software development, and I’m passionate about learning and growing in this fast-evolving field.
      </p>
    </section>
  );
};

export default About;
